import Vue from "vue";
import Vuex from 'vuex';

Vue.use(Vuex)

import { search } from '@/api/home.js'

export default new Vuex.Store({
    state:{
        ss:'',
        searchlists:[],
    },
    mutations:{
        searchdata(state,res){
            console.log(res.data);
            state.searchlists = res.data
        }
    },
    actions:{
        async searchdata_time(context){
            context.commit('searchdata',await search())
        },
    }
})
